message:
A DIREITA DEVE COMEÇAR COM URGENCIA APROVEITAR AS MANIFESTAÇÕES PARA DEFINIR METAS E OBJETIVOS, COMO:
1 - DEFINIR O VERDADEIRO PARTIDO DE DIREITA DO BRASIL E JA COLETAR ASSINATURAS E FAZER TODO O TRAMITE;
2 - DEVEMOS APOIAR ROGERIO MARINHO PARA IMPEACHMENT DO STF;
3 - IMPEACHMENT NOS GOVERNADORES DE ESQUERDA QUE VÃO ENTRAR EM 2023;
